		this.stopButton.addEventListener("click", stopGel.bind(this));
		
		
		function gelStepY(basepairs) {
			/*
			 y = mx + c (when plotted on log/linear graph
			 log(size) = m(dist_travelled) + c (note that the slope m is negative)
			 so dist_travelled = (log(size)-c)/m
			*/
			return (Math.log10(basepairs)-C_CONSTANT) / M_CONSTANT;
		}
		
		
		
		function genotypeFeedback(reality,answer) {
			if (answer==reality)
				return "CORRECT!"
			else if (reality==PLUS_MINUS)
				return "INCORRECT. Since there are two bands the genotype can't be homozygous."
		    else if (answer==PLUS_MINUS)
				return "INCORRECT. Since there is only one band visible the genotype can't be heterozygous."
			else
				return "INCORRECT. Remember that the PCR product from a chromosome with the Alu (+) will be bigger and therefore not travel as far on the gel."
		}
		
		
		function startGel(evt) {
			
			dnaBandsContainer.removeAllChildren();
			for (i=gSamples.length-1; i>LAST_LADDER_BAND; i--)
				gSamples.pop();
		
			switch (_this.primerEvaluation) {
				case PRIMERS_CREATE_NO_PRODUCT:
					break;
				case PRIMERS_CREATE_SMEAR:
					for (lane=1; lane<=4; lane++)
						gSamples.push( new DNA_Band(lane,_this.pcrProductSize,100) ); // i.e. smear over 500bp range
					break;
				case PRIMERS_CREATE_EXTRA_BANDS:
					for (lane=1; lane<=4; lane++) {
						switch (gReality[lane]) {
							case PLUS_PLUS:
								gSamples.push( new DNA_Band(lane,_this.pcrProductSize+ALU_SIZE,0) );
								break
							case PLUS_MINUS:
								gSamples.push( new DNA_Band(lane,_this.pcrProductSize,0) ); // hetero -ve/+ve
								gSamples.push( new DNA_Band(lane,_this.pcrProductSize+ALU_SIZE,0) );
								break
							case MINUS_MINUS:
								gSamples.push( new DNA_Band(lane,_this.pcrProductSize,0) ); // homo -ve
								break
						}
						// now add a few extra non-specific bands which will be in every lane
						gSamples.push( new DNA_Band(lane,520,0) ); // homo -ve
						gSamples.push( new DNA_Band(lane,710,0) ); // homo -ve
						gSamples.push( new DNA_Band(lane,1150,0) ); // homo -ve
					}
					break;
				case PRIMERS_EXCLUDE_ALU:
					for (lane=1; lane<=4; lane++)
						gSamples.push( new DNA_Band(lane,_this.pcrProductSize,0) );
					break;
				case PRIMERS_OK:
					for (lane=1; lane<=4; lane++) {
						switch (gReality[lane]) {
							case PLUS_PLUS:
								gSamples.push( new DNA_Band(lane,_this.pcrProductSize+ALU_SIZE,0) );
								break
							case PLUS_MINUS:
								gSamples.push( new DNA_Band(lane,_this.pcrProductSize,0) ); // hetero -ve/+ve
								gSamples.push( new DNA_Band(lane,_this.pcrProductSize+ALU_SIZE,0) );
								break
							case MINUS_MINUS:
								gSamples.push( new DNA_Band(lane,_this.pcrProductSize,0) ); // homo -ve
								break
						}
					}
					break;
			}	
			
			for (i=0; i<gSamples.length; i++) 
			{
				var band = undefined;
				if (gSamples[i].smearSize > 0) {
					band = new lib.smear_band();
					band.scaleY = 0.02;
				} else
					band = new lib.spotty_band();
				band.x = gLanePosArr[ gSamples[i].lane ].x;
				band.y = gLanePosArr[ gSamples[i].lane ].y;
				dnaBandsContainer.addChild(band);
			}
			_this.isPlaying = true;
		}
		
