		function updateLines()
		{
			console.log('updating lines');
			_this.standardLineG = new createjs.Shape();
			_this.standardLineG.graphics.setStrokeStyle(1).beginStroke("rgba(0,0,0,1)");
			_this.standardLineG.graphics.moveTo(_this.crosses[0].x, _this.crosses[0].y);
					
				// if it's not the first one create a line object that connects all the
				// standard crosses. So 0 up to MIN(nextCrossToMove,lastStandardCross)
		
			var lastSeg = Math.min(_this.lastCrossMoved,_this.lastStandardCross);
			for (i=1; i<= lastSeg; i++) {
				_this.standardLineG.graphics.lineTo(_this.crosses[i].x, _this.crosses[i].y);
			}
			_this.standardLineG.graphics.endStroke();
			stage.addChild(_this.standardLineG);			
			
			if (_this.lastCrossMoved > _this.lastStandardCross) { // then the near cross will have been moved
				var nline = new createjs.Shape();
				stage.addChild(nline);			
				nline.graphics.setStrokeStyle(2).beginStroke("rgba(150,0,0,1)");
				ii = _this.lastStandardCross+1;
				nline.graphics.moveTo(600, _this.crosses[ii].y); // from xaxis to cross
				nline.graphics.lineTo(_this.crosses[ii].x, _this.crosses[ii].y);
				nline.graphics.lineTo(_this.crosses[ii].x, 606); // from cross to yaxis
				nline.graphics.endStroke();
				_this.nearLineG = nline;
			}
			if (_this.lastCrossMoved==_this.crosses.length-1) { // far cross moved.
				var fline = new createjs.Shape();
				stage.addChild(fline);			
				fline.graphics.setStrokeStyle(2).beginStroke("rgba(150,0,0,1)");
				ii = _this.lastStandardCross+2;
				fline.graphics.moveTo(600, _this.crosses[ii].y); // from xaxis to cross
				fline.graphics.lineTo(_this.crosses[ii].x, _this.crosses[ii].y);
				fline.graphics.lineTo(_this.crosses[ii].x, 606); // from cross to yaxis
				fline.graphics.endStroke();
				_this.farLineG = fline;
			}
		}
		
		function removeLines() {
			console.log('removing lines');
			if (_this.standardLineG != undefined)
				stage.removeChild(_this.standardLineG); // since we're about to add it again.
			if (_this.nearLineG != undefined)
				stage.removeChild(_this.nearLineG); // since we're about to add it again.
			if (_this.farLineG != undefined)
				stage.removeChild(_this.farLineG); // since we're about to add it again.
		}
		
		function onMouseDown(evt){
			var item = evt.currentTarget;
			var ii = mapItemToCross(item);
			//console.log('mousedown on item '+item);
			if ((ii==-1) || okToMove(ii)) {
				item.offset = {x:0, y:0};
				var pt = item.parent.globalToLocal(evt.stageX, evt.stageY);
				item.offset.x = pt.x - item.x;
				item.offset.y = pt.y - item.y;
				item.drag = true;
			}
		}
		
		function onMouseMove(evt){
			var item = evt.currentTarget;
			var ii = mapItemToCross(item);
			//console.log('MoveEvent on  '+item);
			if ((ii==-1) || okToMove(ii)) {
				if (item.drag)
				{
					var pt = item.parent.globalToLocal(evt.stageX, evt.stageY);
					item.x = pt.x - item.offset.x;
					if (item != _this.myRuler) {
						item.y = pt.y - item.offset.y;
					}
				}
			}
		}
		
		function onMouseUp(evt){
			var item = evt.currentTarget;
			var ii = mapItemToCross(item);
			if ((ii==-1) || okToMove(ii)) {
				item.drag = false;
				if (ii > _this.lastCrossMoved)
					_this.lastCrossMoved = ii;
				removeLines();
				updateLines();
			}
		}
		
